import logo from "./logo.svg";
import "./App.css";
import { Navbar, Nav, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <Navbar>
      <Container>
        {" "}
        <center>
          <Nav>
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#service">Service</Nav.Link>
          </Nav>
        </center>
      </Container>
    </Navbar>
  );
}

export default App;
